import React, { Component } from "react";
import "./home.css";

class Home extends Component {
  render() {
    return (
      <div id="heroImage" className="content">
        <div uk-scrollspy="cls:uk-animation-fade"></div>
        <div className="homeText .uk-animation-fade" id="homeName">
          Elizabeth Regas
        </div>
        <div className="homeText">
          Developer. Designer. Manipulator of the DOM.
        </div>
      </div>
    );
  }
}

export default Home;
